\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"381\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"277\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"3\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"158\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"422\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"432\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"709\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"438\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"671\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"51\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"50\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"612\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"402\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"450\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"34\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"545\" [:div nil [:div nil]], \"695\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"466\" [:div nil [:div [:p/markdown \"### Promises\\nComing soon.\"]]], \"69\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"382\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"452\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"(-0.011758185058457382\\n 0.18941631108880908\\n 0.6829191079000481\\n 0.6119574581695824\\n 0.8829022482254707\\n 0.7926524712498876\\n 0.9361040528651129\\n 1.0609267257092068\\n 1.5538153900776068)\\n\"}]]]], \"572\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"498\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"321\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"488\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"201\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"820\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"549\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"359\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"380\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"681\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"{:x 3}\\n\"}]]]], \"343\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"467\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"419\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"813\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"567\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"719\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"439\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"265\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.09607562809077475, \"z\" \\a} {\"x\" 1, \"y\" 0.1553020858172981, \"z\" \\b} {\"x\" 2, \"y\" 0.9208210640428242, \"z\" \\c} {\"x\" 3, \"y\" 0.9431154733982899, \"z\" \\a} {\"x\" 4, \"y\" 0.11982097112117529, \"z\" \\b} {\"x\" 5, \"y\" 0.6872358732278815, \"z\" \\c} {\"x\" 6, \"y\" 0.701244165278309, \"z\" \\a} {\"x\" 7, \"y\" 0.3496475904324845, \"z\" \\b} {\"x\" 8, \"y\" 0.6502479163295994, \"z\" \\c})}]]]], \"722\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"650\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"141\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"227\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"767\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"569\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"415\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"384\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"649\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"647\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"430\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"11\\n\"}]]]], \"584\" [:div nil [:div nil]], \"691\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"263\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"139\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"413\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"530\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"157\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"185\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"266\" [:div nil [:div [:p/markdown \"The value is rendered as an [ag-Grid](https://www.ag-grid.com/) component.\"]]], \"616\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"408\" [:div nil [:div nil]], \"600\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"305\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"411\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"49\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"22\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"552\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"175\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"508\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.17901704675496277 0.08905078691004664 -0.39842509443011764 -0.6276173478558318 -0.9236031807569078 -0.4799136463368321 -0.10588423439233319 -0.28858853433797593 -0.053602276805909455 -0.302727456759582 -0.7565839616700447 -0.4484129845113044 -0.6654168958761274 -0.6552132714181188 -0.9319833990944548 -1.115379117581356 -0.6345331717554605 -0.561517473727308 -0.6217113099086573 -0.8456661001673019 -1.0318424133338073 -1.4237133821918664 -1.0611377343218193 -1.1293176040145871 -0.8141899824006383 -0.7176916487936524 -0.47486206571421186 -0.29387900866131267 -0.3377778384809009 0.15651550113393553 0.3642333403754441 0.8599960927852782 1.180415555548553 1.307831410586852 1.6433177957212386 1.7624311125727976 1.696027055148983 1.2102901953048573 1.2179224937756832 1.463211513590537 1.645865694943006 1.6244506114769064 1.9844787777103408 1.9385076539838952 2.044043985243492 2.1546135283207217 2.4200332148396373 2.6738834371713844 2.6296798708875455 2.9915147680153478 3.162815990433109 2.8709304602359507 2.7262834392680904 3.04507104023323 2.835097314468217 3.102039712731636 3.138592072133128 :div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"82\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"355\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"101\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"462\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"662\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"231\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"826\" [:div nil [:div [:p/markdown \"The value is rendered as an [ag-Grid](https://www.ag-grid.com/) component.\"]]], \"116\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"59\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"441\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"89\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"61\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"689\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"395\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"811\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"251\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"57\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"480\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"737\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"169\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"630\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"663\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"607\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"232\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"736\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"472\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"274\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"644\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"556\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"299\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"485\" [:div nil [:div nil]], \"179\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"68\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"389\" [:div [:p/c n \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"547\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"96\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"525\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.23639374150146497, \"z\" \\a} {\"x\" 1, \"y\" 0.428672043910028, \"z\" \\b} {\"x\" 2, \"y\" 0.641572865204542, \"z\" \\c} {\"x\" 3, \"y\" 0.047443233714197675, \"z\" \\a} {\"x\" 4, \"y\" 0.41853656911721404, \"z\" \\b} {\"x\" 5, \"y\" 0.5495902730761941, \"z\" \\c} {\"x\" 6, \"y\" 0.8606193624435631, \"z\" \\a} {\"x\" 7, \"y\" 0.2066903975052965, \"z\" \\b} {\"x\" 8, \"y\" 0.8109759453635811, \"z\" \\c})}]]]], \"588\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"561\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"587\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"426\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"492\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"443\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"329\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"818\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"387\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"585\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"603\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"632\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"159\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"221\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"661\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"819\" [:div [:p/code {:code \"^k/hiccup\\n[:p/leafletmap\\n    {:tile-layer leaflet-providers/Stamen-TonerLite}\\n    [{:type   :view\\n      :center [51.49, -0.08]\\n      :zoom   12\\n      :height 600\\n      :width  700}\\n     {:type   :rectangle\\n      :bounds [[51.49, -0.08]\\n               [51.5, -0.06]]}\\n     {:type      :circle\\n      :center    [51.505, -0.09]\\n      :fillColor :blue\\n      :radius    200}\\n     {:type      :polygon\\n      :positions [[51.515, -0.09]\\n                  [51.52, -0.1]\\n                  [51.52, -0.12]]\\n      :color     :purple}\\n     {:type      :polygon\\n      :positions [[[51.51, -0.12]\\n                   [51.51, -0.13]\\n                   [51.53, -0.13]]\\n                  [[51.51, -0.05]\\n                   [51.51, -0.07]\\n                   [51.53, -0.07]]]\\n      :color     :purple}\\n     {:type      :line\\n      :positions [[51.505, -0.09]\\n                  [51.51, -0.1]\\n                  [51.51, -0.12]]\\n      :color     :lime}\\n     {:type      :line\\n      :positions [[[51.5, -0.1]\\n                   [51.5, -0.12]\\n                   [51.52, -0.12]]\\n                  [[51.5, -0.05]\\n                   [51.5, -0.06]\\n                   [51.52, -0.06]]]\\n      :color     :lime}\\n     {:type     :marker\\n      :position [51.505, -0.09]}\\n     {:type     :marker\\n      :position [51.51, -0.12]\\n      :popup    \\\"wow\\\"}\\n     {:type      :circlemarker\\n      :center    [51.52, -0.06]\\n      :fillColor :blue\\n      :radius    200\\n      :popup     \\\"square the circle\\\"}]]\", :bg-class \"bg-light\"}] [:div [:p/leafletmap {:tile-layer {:url \"https://stamen-tiles-{s}.a.ssl.fastly.net/{variant}/{z}/{x}/{y}{r}.{ext}\", :attribution \"Map tiles by <a href=\\\"http://stamen.com\\\">Stamen Design</a>, <a href=\\\"http://creativecommons.org/licenses/by/3.0\\\">CC BY 3.0</a> &mdash; Map data {attribution.OpenStreetMap}\", :subdomains \"abcd\", :minZoom 0, :maxZoom 20, :variant \"toner-lite\", :ext \"png\"}} [{:type :view, :center [51.49 -0.08], :zoom 12, :height 600, :width 700} {:type :rectangle, :bounds [[51.49 -0.08] [51.5 -0.06]]} {:type :circle, :center [51.505 -0.09], :fillColor :blue, :radius 200} {:type :polygon, :positions [[51.515 -0.09] [51.52 -0.1] [51.52 -0.12]], :color :purple} {:type :polygon, :positions [[[51.51 -0.12] [51.51 -0.13] [51.53 -0.13]] [[51.51 -0.05] [51.51 -0.07] [51.53 -0.07]]], :color :purple} {:type :line, :positions [[51.505 -0.09] [51.51 -0.1] [51.51 -0.12]], :color :lime} {:type :line, :positions [[[51.5 -0.1] [51.5 -0.12] [51.52 -0.12]] [[51.5 -0.05] [51.5 -0.06] [51.52 -0.06]]], :color :lime} {:type :marker, :position [51.505 -0.09]} {:type :marker, :position [51.51 -0.12], :popup \"wow\"} {:type :circlemarker, :center [51.52 -0.06], :fillColor :blue, :radius 200, :popup \"square the circle\"}]]]], \"442\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"425\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"592\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"700\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"80\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"328\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"162\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"192\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"332\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"766\" [:div nil [:div nil]], \"33\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"490\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"738\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"20\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"67\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"759\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"358\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"113\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"345\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that iv [:big [:big \"...\"]]]]], \"586\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"684\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"167\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"98\" [:div nil [:div [:p/markdown \"### Promises\\nComing soon.\"]]], \"714\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"259\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"476\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((4 4 3 3 4 2)\\n (3 1 0 4 4 5)\\n (5 5 3 3 4 1)\\n (4 1 4 1 3 3)\\n (2 5 2 1 0 2)\\n (4 0 0 5 1 0))\\n\"}]]], \"197\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"521\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"598\" [:div [:p/code {:code \"^k/hiccup\\n[:p/leafletmap\\n    {:tile-layer leaflet-providers/Stamen-TonerLite}\\n    [{:type   :view\\n div [:big [:big \"...\"]]]]], \"797\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"658\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"268\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"401\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"354\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"716\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"374\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"456\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"503\" [:div nil [:div [:big [:big 3]]]], \"493\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"226\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"802\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"296\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"362\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"17\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"798\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"512\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"449\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"228\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"727\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"594\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"777\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"740\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"25\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"814\" [:div nil [:div [:big [:big 3]]]], \"553\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"326\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"115\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"621\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"244\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"769\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"73\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"297\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"687\" [:div nil [:div [:p/markdown \"### Promises\\nComing soon.\"]]], \"618\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"379\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"78\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"609\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"225\" [:div nil [:div nil]], \"111\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"639\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"350\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"383\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"294\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"747\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.9061592813082058, \"z\" \\a} {\"x\" 1, \"y\" 0.8785088102011473, \"z\" \\b} {\"x\" 2, \"y\" 0.2827471817764904, \"z\" \\c} {\"x\" 3, \"y\" 0.3882438701810691, \"z\" \\a} {\"x\" 4, \"y\" 0.13623398247136453, \"z\" \\b} {\"x\" 5, \"y\" 0.35366576513312575, \"z\" \\c} {\"x\" 6, \"y\" 0.20125569791753373, \"z\" \\a} {\"x\" 7, \"y\" 0.5916709783616577, \"z\" \\b} {\"x\" 8, \"y\" 0.3971755499745453, \"z\" \\c})}]]]], \"203\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"172\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"278\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"573\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"544\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"489\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"631\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"754\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"311\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"176\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"610\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"741\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"645\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"119\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.17719470749213007 0.23917334941195068 0.012756856657511695 0.1374584922658164 0.12122332051209594 0.020337460850588407 0.12346524473134068 0.5566512837114472 0.25430372117311983 -0.20628376984227104 -0.6417810629945104 -1.0901892309478218 -0.6590467978023253 -1.1214243270235307 -0.8839671145420528 -1.0677753063407853 -1.435156482324933 -1.5787115642179752 -1.6213012411934524 -2.0975731904787116 -2.237520732021316 -2.536821910135152 -2.429732018582608 -2.0938377905140095 -2.179755633789797 -2.3134631070970477 -2.5006584962991627 - tespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"590\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"140\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"623\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"{:x 3}\\n\"}]]]], \"27\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"748\" [:div nil [:div [:p/markdown \"The value is rendered as an [ag-Grid](https://www.ag-grid.com/) component.\"]]], \"597\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"136\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"718\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"337\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"433\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"726\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"347\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"548\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"166\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"121\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"218\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"591\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"542\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"335\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"62\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"685\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"331\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"75\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"352\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"651\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"11\\n\"}]]]], \"194\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"633\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"168\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"24\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"697\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((4 5 2 4 2 0)\\n (1 0 3 2 2 1)\\n (3 4 0 0 2 3)\\n (1 0 0 0 1 2)\\n (3 0 3 5 0 0)\\n (0 4 0 2 5 1))\\n\"}]]], \"376\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"534\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"360\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"399\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"76\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"764\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"241\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"571\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"{:x 3}\\n\"}]]]], \"35\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"293\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"474\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"751\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"772\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"154\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"725\" [:div nil [:div [:big [:big 3]]]], \"540\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"702\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"524\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"823\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"257\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"209\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"239\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"635\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"240\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"577\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"6\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"110\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"537\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"606\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"97\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"710\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"653\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"835\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"(0.28404779174561257\\n 0.6609264172434801\\n 0.6763363543723836\\n 0.9885886416381848\\n 1.1350480955753948\\n 1.2495566332570647\\n 1.274953115821961\\n 1.390292808005909\\n 1.3848461327056958)\\n\"}]]]], \"463\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"558\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"94\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"580\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"559\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and -0.23235320320076241 1.075879810984808 0.23921170898105654 -0.944187088550791 0.38623757948969434 1.1012703182343029 -0.3076212658538451 -0.6762350455473376 0.8376737916231525 0.7405154517977004 -0.8075136319854829 -0.20721841142758185 1.061103361914644 0.14531254476519137 -0.8235990438753364 0.3508773150668172 1.050875334837863 -0.495967221740027 -0.7779905148739581 0.7885420783158654 0.6095438243423397 -0.801360891236512 -0.17518404893326453 1.049999330654421 0.11291231669452839 -0.9020205334629743 0.40111738506471195 0.9285092817558811 -0.36461527733969823 -0.5949892984804639 0.8488141377345836 0.6246007914622108 -0.7687411517371322 -0.23657956554547643 1.1516860911787243 0.14197776500935602 -0.8830970459197098 0.3685027830839741 1.0796966553866332 -0.488927640221886 -0.6522981602772897 0.8215921157577003 0.6178227245149374 -0.8991403119823674 -0.06785871593562698 1.020844753297034 0.14799661409510684 -0.7980637924820062 0.3755412815602134 0.8967349704709627 -0.39002427110847226 -0.5641806112236634 0.8013929620515716 0.6794161275591297 -0.9266429347949592), :limit 100, :svgWidth 100, :svgHeight 20}]]]]], \"421\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"235\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"418\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"70\" [:div nil [:div nil]], \"550\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"206\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"410\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"660\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"216\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there :div [:big [:big \"...\"]]]]], \"84\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"177\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"434\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"473\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"565\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"750\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"744\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"43\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"664\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"344\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"832\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"125\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"729\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.36598410257302016 -0.6893095101346012 -1.0476363008789105 -0.7829382807228382 -0.9554527705872625 -1.3766390788845904 -0.9694959127235359 -1.4206607481496831 -1.783171313703904 -1.6704617309490637 -1.5526718704644744 -1.881348446327841 -1.9659791868898269 -1.8770492872725835 -1.5103573768271157 -1.4172544746631615 -1.7066446963935684 -1.459853778860614 -1.498155491511981 -1.4011004598724353 -1.6611177731427271 -1.7128388385634834 -1.7994931057120849 -2.0239779473460997 -2.2284387064721267 -2.563161700234067 -2.9815023680489663 -2.5402699553418606 -2.899789713833138 -3.2385390770039573 -3.182453642238287 -2.846378274727214 -2.449048896462192 -2.788901195192061 -2.3279309761514835 -2.408922733541123 -2.7172995124303014 -2.749180677721787 -2.7207692411750957 -2.517430857771874 -2.413059275512791 -1.9452920455451594 -1
