 Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"436\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"821\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"233\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"625\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.36598410257302016 -0.6893095101346012 -1.0476363008789105 -0.7829382807228382 -0.9554527705872625 -1.3766390788845904 -0.9694959127235359 -1.4206607481496831 -1.783171313703904 -1.6704617309490637 -1.5526718704644744 -1.881348446327841 -1.9659791868898269 -1.8770492872725835 -1.5103573768271157 -1.4172544746631615 -1.7066446963935684 -1.459853778860614 -1.498155491511981 -1.4011004598724353 -1.6611177731427271 -1.7128388385634834 -1.7994931057120849 -2.0239779473460997 -2.2284387064721267 -2.563161700234067 -2.9815023680489663 -2.5402699553418606 -2.899789713833138 -3.2385390770039573 -3.182453642238287 -2.846378274727214 -2.449048896462192 -2.788901195192061 -2.3279309761514835 -2.408922733541123 -2.7172995124303014 -2.749180677721787 -2.7207692411750957 -2.517430857771874 -2.4130592 m/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"373\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"255\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"539\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"824\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"566\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"816\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.3722885938469793 0.6123304159270788 0.7051883414596637 0.804364096385119 0.8774352369622284 0.5633821846960154 0.3671226857482278 0.04156748418392131 0.4285320478960889 0.04680220129390966 0.5125245597339919 0.47654982290169445 0.3446915 \n* 333\"]]], \"54\" [:div [:p/code {:code \"^k/hiccup\\n[:p/leafletmap\\n    {:tile-layer leaflet-providers/Stamen-TonerLite}\\n    [{:type   :view\\n      :center [51.49, -0.08]\\n      :zoom   12\\n      :height 600\\n      :width  700}\\n     {:type   :rectangle\\n      :bounds [[51.49, -0.08]\\n               [51.5, -0.06]]}\\n     {:type      :circle\\n      :center    [51.505, -0.09]\\n      :fillColor :blue\\n      :radius    200}\\n     {:type      :polygon\\n      :positions [[51.515, -0.09]\\n                  [51.52, -0.1]\\n                  [51.52, -0.12]]\\n      :color     :purple}\\n     {:type      :polygon\\n      :positions [[[51.51, -0.12]\\n                   [51.51, -0.13]\\n                   [51.53, -0.13]]\\n                  [[51.51, -0.05]\\n                   [51.51, -0.07]\\n                   [51.53, -0.07]]]\\n      :color     :purple}\\n     {:type      :line\\n      :positions [[51.505, -0.09]\\n                  [51.51, -0.1]\\n                  [51.51, -0.12]]\\n      :color     :lime}\\n     {:type      :line\\n      :positions [[[51.5, -0.1]\\n                   [51.5, -0.12]\\n                   [51.52, -0.12]]\\n                  [[51.5, -0.05]\\n                   [51.5, -0.06]\\n                   [51.52, -0.06]]]\\n      :color     :lime}\\n     {:type     :marker\\n      :position [51.505, -0.09]}\\n     {:type     :marker\\n      :position [51.51, -0.12]\\n      :popup    \\\"wow\\\"}\\n     {:type      :circlemarker\\n      :center    [51.52, -0.06]\\n      :fillColor :blue\\n      :radius    200\\n      :popup     \\\"square the circle\\\"}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"771\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"16\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"245\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"407\" [:div nil [:div nil]], \"131\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"103\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((4 2 3 1 2 4)\\n (4 2 3 1 2 2)\\n (0 1 5 4 5 3)\\n (4 5 3 1 5 4)\\n (4 2 4 3 1 3)\\n (3 0 3 2 0 0))\\n\"}]]], \"248\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:ul [:li 0 \" \" [:p/sparklinespot {:data (0.18032335128356813 5.874963553252678E-4 0.1699634179838543 0.1967151512465807 0.11427330965487358 0.16858233905192885 0.07291045654127802 0.1572799258899877 0.11814294532585279 0.05879677218435431 0.10403137300442344 0.08551635837999355 0.09354952634305601 0.003347542111955382 0.16946138679667555 0.14822636561819438 0.08785990461094198 0.10503574881038186 0.19400989393517853 0.09568679337439577 0.07278089645972222 0.01826022239111127 0.1928890745449332 0.05591358687919095 0.19589760452697896 0.1360407536273717 0.026085851282483575 0.17336890407420988 0.07264612306316907 0.1348662085802381 0.15608635143746039 0.182205188826312 0.0667398939027 marker\\n      :center    [51.52, -0.06]\\n      :fillColor :blue\\n      :radius    200\\n      :popup     \\\"square the circle\\\"}]]\", :bg-class \"bg-light\"}] [:div [:p/leafletmap {:tile-layer {:url \"https://stamen-tiles-{s}.a.ssl.fastly.net/{variant}/{z}/{x}/{y}{r}.{ext}\", :attribution \"Map tiles by <a href=\\\"http://stamen.com\\\">Stamen Design</a>, <a href=\\\"http://creativecommons.org/licenses/by/3.0\\\">CC BY 3.0</a> &mdash; Map data {attribution.OpenStreetMap}\", :subdomains \"abcd\", :minZoom 0, :maxZoom 20, :variant \"toner-lite\", :ext \"png\"}} [{:type :view, :center [51.49 -0.08], :zoom 12, :height 600, :width 700} {:type :rectangle, :bounds [[51.49 -0.08] [51.5 -0.06]]} {:type :circle, :center [51.505 -0.09], :fillColor :blue, :radius 200} {:type :polygon, :positions [[51.515 -0.09] [51.52 -0.1] [51.52 -0.12]], :color :purple} {:type :polygon, :positions [[[51.51 -0.12] [51.51 -0.13] [51.53 -0.13]] [[51.51 -0.05] [51.51 -0.07] [51.53 -0.07]]], :color :purple} {:type :line, :positions [[51.505 -0.09] [51.51 -0.1] [51.51 -0.12]], :color :lime} {:type :line, :positions [[[51.5 -0.1] [51.5 -0.12] [51.52 -0.12]] [[51.5 -0.05] [51.5 -0.06] [51.52 -0.06]]], :color :lime} {:type :marker, :position [51.505 -0.09]} {:type :marker, :position [51.51 -0.12], :popup \"wow\"} {:type :circlemarker, :center [51.52 -0.06], :fillColor :blue, :radius 200, :popup \"square the circle\"}]]]], \"330\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"679\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"683\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"40\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"161\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"230\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"242\" [:div nil [:div [:big [:big 3]]]], \"129\" [:div nil [:div [:p/markdown \"The value is rendered as an [ag-Grid](https://www.ag-grid.com/) component.\"]]], \"187\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"214\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((3 0 5 5 5 1)\\n (2 1 1 3 1 5)\\n (0 1 1 5 2 3)\\n (3 5 1 0 4 2)\\n (4 2 1 5 1 2)\\n (3 1 3 0 2 3))\\n\"}]]], \"717\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"465\" [:div nil [:div [:p/markdown \"### Promises\\nComing soon.\"]]], \"31\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"71\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"164\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"361\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"163\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(@)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"349\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"675\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"323\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"447\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"86\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"64\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"215\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((3 0 5 5 5 1)\\n (2 1 1 3 1 5)\\n (0 1 1 5 2 3)\\n (3 5 1 0 4 2)\\n (4 2 1 5 1 2)\\n (3 1 3 0 2 3))\\n\"}]]], \"397\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.23639374150146497, \"z\" \\a} {\"x\" 1, \"y\" 0.428672043910028, \"z\" \\b} {\"x\" 2, \"y\" 0.641572865204542, \"z\" \\c} {\"x\" 3, \"y\" 0.047443233714197675, \"z\" \\a} {\"x\" 4, \"y\" 0.41853656911721404, \"z\" \\b} {\"x\" 5, \"y\" 0.5495902730761941, \"z\" \\c} {\"x\" 6, \"y\" 0.8606193624435631, \"z\" \\a} {\"x\" 7, \"y\" 0.2066903975052965, \"z\" \\b} {\"x\" 8, \"y\" 0.8109759453635811, \"z\" \\c})}]]]], \"785\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"393\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"620\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"92\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"464\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"468\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"834\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"417\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"451\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"822\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"351\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"501\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"487\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"770\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"608\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"724\" [:div nil [:div [:big [:big 3]]]], \"672\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}]
